#!/bin/bash
set -e -E

set -euo pipefail

. .env
echo "REST Nano Banana: $GEMINI_API_KEY"

GEMINI_API_KEY="$GEMINI_API_KEY"
MODEL_ID="gemini-2.5-flash-image-preview"
GENERATE_CONTENT_API="streamGenerateContent"

cat << EOF > request.json
{
    "contents": [
      {
        "role": "user",
        "parts": [
          {
            "text": "create image of Duffie Duck on a plane\n"
          },
        ]
      },
      {
        "role": "model",
        "parts": [
          {
            "text": "Here is Daffy Duck on a plane! "
          },
          {
            "inlineData": {
              "mimeType": "image/png",
              "data": ""
            }
          },
        ]
      },
      {
        "role": "user",
        "parts": [
          {
            "text": "Ok now please add Scrooge on top of the plane"
          },
        ]
      },
    ],
    "generationConfig": {
      "responseModalities": ["IMAGE", "TEXT", ],
    },
}
EOF

curl \
-X POST \
-H "Content-Type: application/json" \
"https://generativelanguage.googleapis.com/v1beta/models/${MODEL_ID}:${GENERATE_CONTENT_API}?key=${GEMINI_API_KEY}" -d '@request.json' |
    tee duffie-duck.response.shell.json
